import React, {useEffect, useState} from "react";
import axios from "axios";
import ContractDropdowns from "./ContractDropdowns";

function MappedPlayers() {
  const[player, setPlayer] = useState([]);
  const [salary, setSalary] = useState(0);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/players/')
        .then(res => {
          console.log(res)
          setPlayer(res.data)
        })
        .catch(err => {
          console.log(err)
    })
  }, []);

  return (
      <div>
        <p>
          {
            player.map(player =>
                <p key={player.id}>
                    Name: {player.name} &nbsp; Suit: {player.suit} &nbsp; Age: {player.age} &nbsp; EPV: {player.epv}
                    {salary}
                    <ContractDropdowns/>
                </p>)
          }
        </p>
      </div>
  )
}

export default MappedPlayers
